import React, {FC} from "react";
import {AncmntAutoForm} from "./AncmntAutoForm";
import {AncmntStateTypes, CreateAncmntFields} from "@root/interfaces/Announcement";


type AncmntAutoFormPropsTypes = {
    setValues: (values: React.SetStateAction<CreateAncmntFields>, shouldValidate?: boolean | undefined) => void;
    createAncmnt: AncmntStateTypes;
};

export const AncmntAutoFormContainer: FC<AncmntAutoFormPropsTypes> = (props) => {
    const {setValues, createAncmnt} = props;
    console.log(createAncmnt)
    return (
        <AncmntAutoForm {...props} />
    )
};
